import numpy as np
from typing import List

def perimeter_comparison(contour1: List[List[int]], contour2: List[List[int]]) -> float:
    perimeter1 = np.sum(np.sqrt(np.sum(np.diff(contour1 + [contour1[0]], axis=0)**2, axis=1)))
    perimeter2 = np.sum(np.sqrt(np.sum(np.diff(contour2 + [contour2[0]], axis=0)**2, axis=1)))

    return abs(perimeter1 - perimeter2)
